import React from 'react'
import Gauge from './Gauge.js'

function GaugeHolder() {
    const difficulty = 45;
    const altitude = 5919;
    const length = 2415;

    return (
        <div class="gauges">
            <Gauge name={"Difficulty"} id={"gauge-chart1"}/>
            <Gauge id={"Altitude"} id={"gauge-chart2"}/>
            <Gauge id={"Length"} id={"gauge-chart3"}/>
        </div>
    )
} 

export default GaugeHolder
